import React from "react";

function Header({ id, nombre, raza, edad }) {

console.log(id);

    return (
        <>

            <h1>Header</h1>
            <ul>
                <li>id: {id}</li>
                <li>nombre: {nombre}</li>
                <li>raza: {raza}</li>
                <li>edad: {edad}</li>
            </ul>
        </>
    )
}

export default Header;
